import React from 'react';
import PropTypes from 'prop-types';

const TimerDisplay = ({ time }) => (
    <div 
        id="timer-display"
        className="timer"
    >
        <h3 id="time-left">
            {time}
        </h3>
    </div>
);

TimerDisplay.propTypes = {
    time: PropTypes.string
};

export { TimerDisplay };
